import React, { Component } from "react";
import TutorialDataService from "../services/tutorial.service";
import { Link } from "react-router-dom";

export default class TutorialsList extends Component {
  constructor(props) {
    super(props);
    this.onChangeSearchTitle = this.onChangeSearchTitle.bind(this);
    this.retrieveTutorials = this.retrieveTutorials.bind(this);
    this.refreshList = this.refreshList.bind(this);
    this.setActiveCustomer = this.setActiveCustomer.bind(this);
    this.removeAllTutorials = this.removeAllTutorials.bind(this);
    this.searchTitle = this.searchTitle.bind(this);

    this.state = {
      customers: [],
      currentCustomer: null,
      currentIndex: -1,
      searchTitle: "",
      orders: []
    };
  }

  componentDidMount() {
    this.retrieveTutorials();
  }

  onChangeSearchTitle(e) {
    const searchTitle = e.target.value;

    this.setState({
      searchTitle: searchTitle
    });
  }

  retrieveTutorials() {
    TutorialDataService.getAll()
      .then(response => {
        this.setState({
          customers: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  retrieveOrders() {
    TutorialDataService.getAll()
    .then(response => {
      this.setState({
        orders: response.data
      });
      console.log(response.data);
    })
    .catch(e => {
      console.log(e);
    });
  }

  refreshList() {
    this.retrieveTutorials();
    this.retrieveOrders();
    this.setState({
      currentCustomer: null,
      currentIndex: -1
    });
  }

  setActiveCustomer(tutorial, index) {
    this.setState({
      currentCustomer: tutorial,
      currentIndex: index
    });
  }

  removeAllTutorials() {
    TutorialDataService.deleteAll()
      .then(response => {
        console.log(response.data);
        this.refreshList();
      })
      .catch(e => {
        console.log(e);
      });
  }

  searchTitle() {
    this.setState({
      currentCustomer: null,
      currentIndex: -1
    });

    TutorialDataService.findByTitle(this.state.searchTitle)
      .then(response => {
        this.setState({
          customers: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  render() {
    const { searchTitle, customers, currentCustomer, currentIndex, orders } = this.state;

    return (
      <div className="list row">
        <div className="col-md-8">
          <div className="input-group mb-3">
            <input
              type="text"
              className="form-control"
              placeholder="Search by title"
              value={searchTitle}
              onChange={this.onChangeSearchTitle}
            />
            <div className="input-group-append">
              <button
                className="btn btn-outline-secondary"
                type="button"
                onClick={this.searchTitle}
              >
                Search
              </button>
            </div>
          </div>
        </div>
        <div className="col-md-6">
          <h4>Customer List</h4>
          <ul className="list-group">
            {customers &&
              customers.map((tutorial, index) => (
                <li
                  className={
                    "list-group-item " +
                    (index === currentIndex ? "active" : "")
                  }
                  onClick={() => this.setActiveCustomer(tutorial, index)}
                  key={index}
                >
                  {tutorial.first_name} {tutorial.middle_initial} {tutorial.last_name}
                </li>
              ))}
          </ul>

          <button
            className="m-3 btn btn-sm btn-danger"
            onClick={this.removeAllTutorials}
          >
            Remove All
          </button>
        </div>
        <div className="col-md-6">
          {currentCustomer ? (
            <div>
              <h4>Customer Detail</h4>
              <div>
                <label>
                  <strong>First name:</strong>
                </label>{" "}
                {currentCustomer.first_name}
              </div>
              <div>
                <label>
                  <strong>Middle name:</strong>
                </label>{" "}
                {currentCustomer.middle_initial}
              </div>
              <div>
                <label>
                  <strong>Last name:</strong>
                </label>{" "}
                {currentCustomer.last_name}
              </div>

              <div>
                <Link
                  to={"/tutorials/" + currentCustomer.customer_id}
                  className="badge badge-warning"
                >
                  Edit Customer Detail
                </Link>
                <br></br>
                <Link
                  to={"/orders/" + currentCustomer.customer_id}
                  className="badge badge-success"
                >
                  Place New Order
                </Link>
              </div>

              <div>
                <label>
                  <strong>Previous Orders:</strong>
                </label>
                <ul className="list-group">
                  {orders &&
                    orders.map((tutorial, index) => (
                      <li
                        className={
                          "list-group-item " +
                          (index === currentIndex ? "active" : "")
                        }
                        onClick={() => this.setActiveCustomer(tutorial, index)}
                        key={index}
                      >
                        {tutorial.first_name} {tutorial.middle_initial} {tutorial.last_name}
                      </li>
                    ))}
                </ul>
              </div>
            </div>
          ) : (
            <div>
              <br />
              <p>Click on a Customer, to view details...</p>
            </div>
          )}
        </div>
      </div>
    );
  }
}
